import YearInterval from './time-interval-year.js';

const year = new YearInterval(
  'year',
  d => {
    d.setMonth(0, 1);
    d.setHours(0, 0, 0, 0);
  },
  (d, s) => d.setFullYear(d.getFullYear() + s),
  (s, e) => e.getFullYear() - s.getFullYear(),
  d => d.getFullYear()
);

export default year;
